class Solution:
    def deserialize(self, s):
        if s[0] != '[':  # 單個整數
            return NestedInteger(int(s))

        stack = []
        num = ''
        negative = False

        for c in s:
            if c == '-':
                negative = True
            elif c.isdigit():
                num += c
            elif c == '[':
                stack.append(NestedInteger())
            elif c in ',]':
                if num:
                    value = int(num) if not negative else -int(num)
                    stack[-1].add(NestedInteger(value))
                    num = ''
                    negative = False
                if c == ']' and len(stack) > 1:
                    ni = stack.pop()
                    stack[-1].add(ni)

        return stack[0]
